description:
HYBRID PLANNING APPLICATION for the phased demolition of all existing buildings and structures, site preparation works and the comprehensive residential-led mixed use redevelopment of Colosseum Retail Park comprising:

DETAILED planning application for the construction of four buildings  comprising residential dwellings (Use Class C3), flexible commercial floorspace including a Work Hub (Use Classes A1, A2, A3, A4, B1, D1 and/or D2), ancillary car/cycle parking, amenity, plant, all other associated public, communal and private realm, soft/hard landscaping, infrastructure, access and highway works, and any temporary landscaping, parking and access arrangements; 

OUTLINE planning application (with all matters reserved) for the construction of six development plots  comprising residential floorspace (Use Class C3) including any ancillary internal parking, amenity, and plant; flexible commercial floorspace (Use Class A1, A2, A3, A4, B1, D1 and D2), and all other associated public, communal and private realm, soft/hard landscaping, infrastructure and highway works, access and a new internal road network.
